import React, {useState} from 'react';
import { Container } from '../../components/Container';
import { KrosvordComponent } from '../../components/KrosvordComponent';

import { data, question } from './_mock_'
export const Krosvord = () => {
    const [counter, setConuter]=useState(0)

    return (
        <Container
        left={<KrosvordComponent maxX={8} maxY={5} words={data.left} question={question.left} setConuter={setConuter} count={counter}/>}
        right={<KrosvordComponent words={data.right} question={question.right} right={true} setConuter={setConuter} count={counter}
        />}
        buttonText={counter>1 && 'К следующим испытаниям'}
        url='/rebus'
    />
    );
};
